import React, { Component } from 'react';

import Summary from '../../components/order/checkoutSum';

class Checkout extends Component {
    state={
        ingredients: {
            salad: 0,
            meat: 0,
            cheese: 0,
            bacon: 0
        }
    }

    render() {
        return (
            <div>
                <Summary ingredients={this.state.ingredients}/>
            </div>
        );
    }
};

export default Checkout;
